defmodule Day5 do
  @moduledoc """
  Documentation for Day5.
  """

  @doc """
  iex> Day5.solution_1()
  9562
  """
  def solution_1 do
    dissolve(Day5.Input.input())
  end

  @doc """
  iex> Day5.solution_2()
  4934
  """
  def solution_2 do
    Day5.Input.input()
    |> :binary.bin_to_list()
    |> Enum.reduce(%{}, fn
      to_reduce, reduced -> check_next_polymer(to_reduce, reduced, Day5.Input.input())
    end)
    |> Enum.sort_by(fn {_x, y} -> y end)
    |> hd()
    |> elem(1)
  end

  defp to_lower(value) when value <= ?Z, do: value + 32
  defp to_lower(value), do: value

  defp check_next_polymer(type_to_reduce, reduced, whole_polymer) do
    case to_lower(type_to_reduce) in Map.keys(reduced) do
      true ->
        reduced

      false ->
        polymer = dissolve(remove(type_to_reduce, whole_polymer))
        Map.put(reduced, to_lower(type_to_reduce), polymer)
    end
  end

  defp remove(char, string) do
    string
    |> String.split([<<to_lower(char)>>, <<to_lower(char) - 32>>], trim: true)
    |> Enum.join("")
  end

  defp dissolve(polymer) do
    <<first, rest::binary>> = polymer
    dissolve([first], rest)
  end

  defp dissolve(solution, "") do
    length(solution)
  end

  defp dissolve([x | rest], <<y, remainder::binary>>) when x + 32 == y or y + 32 == x do
    dissolve(rest, remainder)
  end

  defp dissolve(list, <<x, y, remainder::binary>>) when x + 32 == y or y + 32 == x do
    dissolve(list, remainder)
  end

  defp dissolve(list, <<x, remainder::binary>>) do
    dissolve([x | list], remainder)
  end
end

defmodule Day5.Input do
  def input do
    ""
  end
end
